import React from "react";
import { Switch, Route } from "react-router-dom";
import './App.css';
import ToDoList from './pages/ToDoList';

function App() {
  return (
    <Switch>
      <Route path="/">
        <ToDoList />
      </Route>
    </Switch>
  );
}

export default App;
